window.bookSummaryJSON = "<p>This is the first volume of the Childers Trilogy</p> <p>Jan Childers grew up orphaned in the slums of decaying post-diaspora Earth. She was raped, beaten, and starved. Yet she survived.</p> <p>She escaped to become a citizen of the Commonwealth of Free Planets and joined the Commonwealth Space Force.</p> <p>Over the next 20 years, she turned the CSF into the most powerful and dangerous space fleet that history had ever known.</p> <p>Jan Childers rose to lead that fleet in the Commonwealth's darkest hour, against freedom's most deadly enemy - Earth itself.</p>"; 
